import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../styles/Navbar.css'; // Ensure this file exists with appropriate styling

const Navbar = () => {
  const vendorLoggedIn = localStorage.getItem('vendorLoggedIn') === 'true';
  const vendorStoreName = localStorage.getItem('vendorStoreName') || '';
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);

  const handleLogout = () => {
    localStorage.removeItem('vendorLoggedIn');
    localStorage.removeItem('vendorStoreName');
    navigate('/');
    window.location.reload();
  };

  return (
    <nav
      style={{
        position: 'fixed',
        top: 0,
        left: 0,
        right: 0,
        backgroundColor: '#ffa24d',
        padding: '1rem 2rem',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        zIndex: 1000,
      }}
    >
      <div>
        <Link
          to="/"
          style={{
            color: '#fff',
            marginRight: '1rem',
            textDecoration: 'none',
            fontWeight: 'bold',
          }}
        >
          oppey
        </Link>
      </div>
      <div style={{ display: 'flex', alignItems: 'center' }}>
        {vendorLoggedIn ? (
          <>
            <span style={{ color: '#fff', marginRight: '1rem', fontWeight: 'bold' }}>
              {vendorStoreName}
            </span>
            <div style={{ position: 'relative' }}>
              <div
                onClick={() => setMenuOpen(!menuOpen)}
                style={{
                  width: '25px',
                  cursor: 'pointer',
                  display: 'flex',
                  flexDirection: 'column',
                  justifyContent: 'space-between',
                  height: '18px',
                }}
              >
                <div style={{ width: '100%', height: '3px', backgroundColor: '#fff' }}></div>
                <div style={{ width: '100%', height: '3px', backgroundColor: '#fff' }}></div>
                <div style={{ width: '100%', height: '3px', backgroundColor: '#fff' }}></div>
              </div>
              {menuOpen && (
                <div
                  style={{
                    position: 'absolute',
                    top: '30px',
                    right: 0,
                    backgroundColor: '#fff',
                    border: '1px solid #ccc',
                    borderRadius: '4px',
                    minWidth: '150px',
                    boxShadow: '0 2px 5px rgba(0,0,0,0.15)',
                    zIndex: 1001,
                  }}
                >
                  <Link
                    to="/account"
                    style={{
                      display: 'block',
                      padding: '0.5rem 1rem',
                      color: '#333',
                      textDecoration: 'none',
                    }}
                    onClick={() => setMenuOpen(false)}
                  >
                    My Account
                  </Link>
                  <Link
                    to="/vendor"
                    style={{
                      display: 'block',
                      padding: '0.5rem 1rem',
                      color: '#333',
                      textDecoration: 'none',
                    }}
                    onClick={() => setMenuOpen(false)}
                  >
                    Dashboard
                  </Link>
                  <Link
                    to="/settings"
                    style={{
                      display: 'block',
                      padding: '0.5rem 1rem',
                      color: '#333',
                      textDecoration: 'none',
                    }}
                    onClick={() => setMenuOpen(false)}
                  >
                    Settings
                  </Link>
                  <button
                    onClick={handleLogout}
                    style={{
                      display: 'block',
                      width: '100%',
                      padding: '0.5rem 1rem',
                      backgroundColor: 'transparent',
                      border: 'none',
                      textAlign: 'left',
                      color: '#333',
                      cursor: 'pointer',
                    }}
                  >
                    Log Out
                  </button>
                </div>
              )}
            </div>
          </>
        ) : (
          <>
            <Link
              to="/login/customer"
              style={{
                color: '#fff',
                marginRight: '1rem',
                textDecoration: 'none',
              }}
            >
              Login as Customer
            </Link>
            <Link
              to="/login/vendor"
              style={{
                color: '#fff',
                marginRight: '1rem',
                textDecoration: 'none',
              }}
            >
              Login as Vendor
            </Link>
            <Link
              to="/register/store"
              style={{ color: '#fff', textDecoration: 'none' }}
            >
              Register as Store
            </Link>
          </>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
